import React from "react";
import Card from "../UI/Card";
import styles from "./User.module.css";

function User(){

    return (
        <Card className={styles.user}>
    <form >
        <label>Username</label>
        <input type="text" />
        <label>Age(Years)</label>
        <input type="number" />
        <button type="submit">Add User </button>
    </form>
    </Card>
    )


}

export default User;
